import React from "react";
import styled from "styled-components";

function UserList() {
    return <Container></Container>;
}

export default UserList;

const Container = styled.div`
    display: flex;
    flex-direction: column;
    flex: 0.15;
    height: 100vh;
    background-color: #2f3135;
`;
